import React, {useState} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: 'auto',
      minWidth:'30ch'
    },
  },
}));


export default function BasicTextFields(props) {


  const classes = useStyles();
  const [age, setAge] = useState("");
  const [Total_Bilirubin, setTotal_Bilirubin] = useState("");
  const [Direct_Bilirubin, setDirect_Bilirubin] = useState("");
  const [Alkaline_Phosphotase, setAlkaline_Phosphotase] = useState("");
  const [Alamine_Aminotransferase, setAlamine_Aminotransferase] = useState("");
  const [Aspartate_Aminotransferase, setAspartate_Aminotransferase] = useState("");
  const [Total_Protiens, setTotal_Protiens] = useState("");
  const [Albumin, setAlbumin] = useState("");
  const [Albumin_and_Globulin_Ratio, setAlbumin_and_Globulin_Ratio] = useState("");

  console.log(age);


  return (
    <form className={classes.root} noValidate autoComplete="off">
      <TextField id="outlined-basic" label={props.label[0]}  variant="outlined" onChange={(e) => setAge(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[2]}  variant="outlined" onChange={(e) => setAge(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[3]}  variant="outlined" onChange={(e) => setAge(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[4]}  variant="outlined" onChange={(e) => setAge(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[5]}  variant="outlined" onChange={(e) => setAge(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[6]}  variant="outlined" onChange={(e) => setAge(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[7]}  variant="outlined" onChange={(e) => setAge(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[8]}  variant="outlined" onChange={(e) => setAge(e.target.value)}/>
      <TextField id="outlined-basic" label={props.label[9]}  variant="outlined" onChange={(e) => setAge(e.target.value)}/>


    </form>

  );
}
